import React from "react";

const Login = () => {
  return (
    <Login1 className={props.className}>
      <LoginView>
        <Rectangle1></Rectangle1>
        <Account />
        <Account1 />
        <ForgotPasword>{`Quên mật khẩu?`}</ForgotPasword>
        <Button1>
          <Rectangle18></Rectangle18>
          <Login>{`Đăng nhập`}</Login>
        </Button1>
        <Frame38>
          <Frame5028>
            <LoginUsingGoogle>{`Đăng nhập bằng Google`}</LoginUsingGoogle>
          </Frame5028>
          <Way>{`Hoặc`}</Way>
          <Frame5029></Frame5029>
        </Frame38>
        <Image2 src={Image2Image} loading="lazy" alt={'image 2'} />
        <Frame50291></Frame50291>
        <Image3 src={Image3Image} loading="lazy" alt={'image 3'} />
        <AccountRequest>
          <AccountRequestSpan1>{`Bạn chưa có tài khoản ? `}</AccountRequestSpan1>
          <AccountRequestSpan2>{` Đăng kí ngay`}</AccountRequestSpan2>
          <AccountRequestSpan3>{` `}</AccountRequestSpan3>
        </AccountRequest>
      </LoginView>
    </Login1>
  );
};

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  border: 1px solid #000;
  overflow: hidden;
  position: relative;
  display: flex;
  padding: 0 20px;
`;

const BackgroundImage = styled.img`
  position: absolute;
  height: 100%;
  width: 100%;
  object-fit: cover;
  object-position: center;
`;

const Content = styled.div`
  position: relative;
  border-radius: 20px;
  background-color: #fff;
  display: flex;
  width: 528px;
  max-width: 100%;
  flex-direction: column;
  align-items: center;
  margin: 87px 0 228px;
  padding: 25px 38px 25px 39px;
  @media (max-width: 991px) {
    margin: 40px 0;
    padding: 0 20px;
  }
`;

const Logo = styled.img`
  aspect-ratio: 1.01;
  object-fit: contain;
  object-position: center;
  width: 80px;
  overflow: hidden;
  max-width: 100%;
`;

const Text = styled.div`
  color: #1b6aaa;
  margin-top: 22px;
  white-space: nowrap;
  font: 400 18px/27px Poppins, sans-serif;
  @media (max-width: 991px) {
    white-space: initial;
  }
`;

const GoogleLogin = styled.div`
  display: flex;
  margin-top: 19px;
  width: 278px;
  max-width: 100%;
  gap: 6px;
`;

const GoogleLogo = styled.img`
  aspect-ratio: 0.9;
  object-fit: contain;
  object-position: center;
  width: 54px;
  overflow: hidden;
  max-width: 100%;
`;

const GoogleText = styled.div`
  color: #000;
  align-self: center;
  white-space: nowrap;
  margin: auto 0;
  font: 400 18px/27px Poppins, sans-serif;
  @media (max-width: 991px) {
    white-space: initial;
  }
`;

const OrSection = styled.div`
  align-self: stretch;
  display: flex;
  margin-top: 22px;
  justify-content: space-between;
  gap: 0px;
  @media (max-width: 991px) {
    max-width: 100%;
    flex-wrap: wrap;
  }
`;

const Line = styled.div`
  border-bottom: 1px solid #000;
  display: flex;
  width: 198px;
  height: 22px;
  flex-direction: column;
`;

const OrText = styled.div`
  display: flex;
  flex-grow: 1;
  flex-basis: 0%;
  flex-direction: column;
  padding: 2px 0;
`;

const OrTextContent = styled.div`
  color: #000;
  white-space: nowrap;
  margin: -20px 0 4px;
  font: 400 18px/27px Poppins, sans-serif;
  @media (max-width: 991px) {
    white-space: initial;
  }
`;

const InputSection = styled.div`
  color: #000;
  align-self: stretch;
  margin-top: 27px;
  white-space: nowrap;
  font: 400 18px/25px Nunito, sans-serif;
  @media (max-width: 991px) {
    max-width: 100%;
    white-space: initial;
  }
`;

const InputLabel = styled.div`
  color: #000;
  align-self: stretch;
  margin-top: 25px;
  white-space: nowrap;
  font: 400 17px/23px Nunito, sans-serif;
  @media (max-width: 991px) {
    max-width: 100%;
    white-space: initial;
  }
`;

const InputValue = styled.div`
  color: #808080;
  max-width: 325px;
  border-radius: 9px;
  border: 1px solid #adadad;
  background-color: #fff;
  align-self: stretch;
  margin-top: 22px;
  align-items: start;
  padding: 22px 20px;
  font: 300 16px/22px Nunito, sans-serif;
  @media (max-width: 991px) {
    max-width: 100%;
    padding-left: 5px;
  }
`;

const Button = styled.div`
  color: #fff;
  white-space: nowrap;
  border-radius: 10px;
  box-shadow: 0px 4px 19px 0px rgba(119, 147, 65, 0.3);
  background-color: #1b6aaa;
  margin-top: 27px;
  width: 236px;
  max-width: 100%;
  align-items: center;
  padding: 18px 20px;
  font: 500 18px/25px Nunito, sans-serif;
  @media (max-width: 991px) {
    white-space: initial;
  }
`;

const ForgotPassword = styled.div`
  color: #1b6aaa;
  margin-top: 23px;
  white-space: nowrap;
  font: 500 18px/25px Nunito, sans-serif;
  @media (max-width: 991px) {
    white-space: initial;
  }
`;

export default Login;
